export default function Input () {
    return (
        <main>
        <form className="form">
        <input className="form--input" placeholderText="Top text" type="text"/>
        <input className="form--input" placeholderText="Bottom text" type="text"/>
        <button className="form--button">Get a new meme image</button>
        </form>
        </main>
    )
}
